import MyNav from "./components/MyNav";
import Slider from "./components/Slider";
import Home from "./pages/Home";
import { BrowserRouter, Routes, Route } from "react-router-dom";

function App() {
  return (
    <div>
      <BrowserRouter>
        <MyNav />
        <Routes>
          <Route />
        </Routes>
        <Slider />
        <Home />
      </BrowserRouter>
    </div>
  );
}
export default App;
